import styled from "styled-components";

export const Form = styled.form`
  display: flex;
  flex-direction: column;
  gap: 20px;
  height: 100%;
`;

export const Container = styled.div`
  display: flex;
  justify-content: space-evenly;
`;

export const Inner = styled.div`
  display: flex;
  flex-wrap: w
  gap: 5px;
`;
